ALTER TABLE `creature_template_scaling`
    ADD COLUMN `HealthScalingExpansion` INT NOT NULL DEFAULT 0 AFTER `ContentTuningID`,
    ADD COLUMN `HealthModifier` FLOAT NOT NULL DEFAULT 1 AFTER `HealthScalingExpansion`,
    ADD COLUMN `ManaModifier` FLOAT NOT NULL DEFAULT 1 AFTER `HealthModifier`,
    ADD COLUMN `ArmorModifier` FLOAT NOT NULL DEFAULT 1 AFTER `ManaModifier`,
    ADD COLUMN `DamageModifier` FLOAT NOT NULL DEFAULT 1 AFTER `ArmorModifier`,
    ADD COLUMN `CreatureDifficultyID` INT NOT NULL DEFAULT 0 AFTER `DamageModifier`;
            
-- Update (DifficultyIDToDifficultyEntryIndex ref)
UPDATE `creature_template_scaling` AS cts
INNER JOIN `creature_template` AS ct ON cts.`Entry`=ct.`entry`
SET cts.`HealthScalingExpansion` = ct.`HealthScalingExpansion`,
    cts.`HealthModifier` = ct.`HealthModifier`,
    cts.`ManaModifier` = ct.`ManaModifier`,
    cts.`ArmorModifier` = ct.`ArmorModifier`,
    cts.`DamageModifier` = ct.`DamageModifier`,
    cts.`CreatureDifficultyID` = ct.`CreatureDifficultyID`;

UPDATE `creature_template_scaling` AS cts
INNER JOIN `creature_template` AS ct ON cts.`Entry`=ct.`entry`
INNER JOIN `creature_template` AS ctd ON ct.`difficulty_entry_1`=ctd.`entry`
SET cts.`HealthScalingExpansion` = ctd.`HealthScalingExpansion`,
    cts.`HealthModifier` = ctd.`HealthModifier`,
    cts.`ManaModifier` = ctd.`ManaModifier`,
    cts.`ArmorModifier` = ctd.`ArmorModifier`,
    cts.`DamageModifier` = ctd.`DamageModifier`,
    cts.`CreatureDifficultyID` = ctd.`CreatureDifficultyID`
WHERE cts.`DifficultyId`=2 AND ct.`difficulty_entry_1` != 0;

UPDATE `creature_template_scaling` AS cts
INNER JOIN `creature_template` AS ct ON cts.`Entry`=ct.`entry`
INNER JOIN `creature_template` AS ctd ON ct.`difficulty_entry_2`=ctd.`entry`
SET cts.`HealthScalingExpansion` = ctd.`HealthScalingExpansion`,
    cts.`HealthModifier` = ctd.`HealthModifier`,
    cts.`ManaModifier` = ctd.`ManaModifier`,
    cts.`ArmorModifier` = ctd.`ArmorModifier`,
    cts.`DamageModifier` = ctd.`DamageModifier`,
    cts.`CreatureDifficultyID` = ctd.`CreatureDifficultyID`
WHERE cts.`DifficultyId`=5 AND ct.`difficulty_entry_2` != 0;

UPDATE `creature_template_scaling` AS cts
INNER JOIN `creature_template` AS ct ON cts.`Entry`=ct.`entry`
INNER JOIN `creature_template` AS ctd ON ct.`difficulty_entry_3`=ctd.`entry`
SET cts.`HealthScalingExpansion` = ctd.`HealthScalingExpansion`,
    cts.`HealthModifier` = ctd.`HealthModifier`,
    cts.`ManaModifier` = ctd.`ManaModifier`,
    cts.`ArmorModifier` = ctd.`ArmorModifier`,
    cts.`DamageModifier` = ctd.`DamageModifier`,
    cts.`CreatureDifficultyID` = ctd.`CreatureDifficultyID`
WHERE cts.`DifficultyId`=6 AND ct.`difficulty_entry_3` != 0;

